/*  API/getCourses.js
    Robin Marillia

    Recupere les todos depuis un site distant
*/

function getTodos(callback){

    fetch("http://www.mocky.io/v2/5ebab22a3600006100f7e279",{
        method: 'GET',
        headers: {
            Accept: 'application/json',
        },
    } 
      ).then(function(response) {

        return response.text()
      }).then(function (value) {

            //var json = JSON.parse({value})
            // const words = value.split("[");

            value.replace( /(^.*\[|\].*$)/g, '' );
            console.log(value)


            callback(value)
      })
}

export default getTodos
